import {Route, Routes} from 'react-router-dom';

// Import Pages
import Index from './pages/index'

export default function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={Index} errorElement={Index}/>
        <Route path='/soporte' element={Index} errorElement={Index}/>
        <Route path='/preguntas-frecuentes' element={Index} errorElement={Index}/>
      </Routes>
    </div>
  );
}
